import Carousel from "react-bootstrap/Carousel";
import styled from "styled-components";

const Frame = styled.div`
  width: auto;
  height: 400px;
  background-color: #edcac4;
  display: flex;
  justify-content: center;
  align-items: center;
  color: white;
  font-size: 24px;
  font-weight: bold;
  text-align: center;
`;

const StyledDiv = styled.div`
  height: auto;
  width: auto;
  background-color: #edcac4;
`;

const StyledItem = styled(Carousel.Item)`
  display: flex;
  justify-content: center;
  align-items: center;

  & img {
    width: auto;
    max-height: 100%;
  }
`;

function HomePage() {
  return (
    <Carousel>
      <Carousel.Item>
        <Frame>first</Frame>
        <Carousel.Caption>
          <h3>First Slide</h3>
          <p>This is the caption for the first slide.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <Frame>second</Frame>

        <Carousel.Caption>
          <h3>Second Slide</h3>
          <p>This is the caption for the second slide.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <Frame>third</Frame>

        <Carousel.Caption>
          <h3>Third Slide</h3>
          <p>This is the caption for the third slide.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default HomePage;
